    var factor = 0;
    for (var i=0; i<description.length; ++i) {
        var c = description.charAt(i);

        if (c>='0' && c<='9') {
            factor = factor*10+parseInt(c);
        } else {
            if (c==' ') continue;
            var dir = this.directionForChar(c);
            for (var j=0; j<Math.max(factor,1); ++j) {
