function (level) {
    var borders = level.getBordersFor(this.start);
    var d = pt(0,0);
    var firstDirection = this.directions[0];
    if (borders.left || borders.right) {
        d = pt(borders.left?-1:1,0);
        if (firstDirection && (borders.top || borders.bottom)) {
            d = firstDirection.apply(pt(0,0)).negated;
        }
    } else if (borders.top || borders.bottom) {
        d = pt(0,borders.top?-1:1);
    } else {
        throw "calculatePrestart: point not at the edge";
