function (waveIndex) {
    this.creeps = [];
    this.spawnEvents = [];
    this.passedTimeInWave = 0;

    var currentWave = this.currentDescription.waves[waveIndex];

    for (var pathIndex=0; pathIndex<currentWave.length; ++pathIndex) {
        var currentPath = this.currentDescription.paths[pathIndex];
        var spawnTime = 0;

        for (var eventIndex=0; eventIndex<currentWave[pathIndex].length; ++eventIndex) {
            var currentEvent = currentWave[pathIndex][eventIndex];
            switch (currentEvent.type) {
                case 'pause':
                    spawnTime += currentEvent.duration;
                break;
                case 'spawn':
                    for (var creepCount=0; creepCount < currentEvent.count; creepCount++) {
                        this.spawnEvents.push({ path: currentPath, time: spawnTime, creep: currentEvent.creep });
                        spawnTime += this.currentDescription.spawnInterval;
                    }
                break;
            }
        }
    }

    this.spawnEvents = this.spawnEvents.sort(function(event1, event2) { return event1.time - event2.time; });
}

