function (delta) {
    if (this.isPathComplete) {
        return;
    }

    this.animation.update(delta);

    var deltaS = delta * this.velocity;

    var s = this.step.interpolationValue + deltaS;
    var skippedSteps = Math.floor(s);
    this.step.interpolationValue = s - skippedSteps;

    for (var i=0; i<skippedSteps; ++i) {
        this.step.from = this.step.to;

        if (this.currentPathIndex == this.path.getLength()) {
            this.step.to = this.path.postend;
            this.currentDirection = this.path.postendDirection;
            this.currentPathIndex++;
        } else if (this.currentPathIndex > this.path.getLength()) {
            this.completePath();
        } else /* if (this.currentPathIndex < this.path.getLength()) */ {
            this.currentDirection = this.path.directions[this.currentPathIndex];
            this.step.to = this.currentDirection.apply(this.step.to);
            this.currentPathIndex++;
        }
    }
   this.animation.setState(this.currentDirection.toString());

this.moveTo(this.step.from.addPt(this.step.to.subPt(this.step.from).scaleBy(this.step.interpolationValue)));
}

